import logo from './logo.svg';
import AOS from 'aos';
import './App.css';

function App() {
  AOS.init();
  return (
    <div className="App">
      <header className="App-header">
        <nav class="navbar sticky-top">
          <a class="navbar-brand" href="https://reactjs.org">Default</a>
        </nav>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <div className="main-body">
        <h1 data-aos="fade-up" data-aos-anchor-placement="top-center">sample</h1>
      </div>
    </div>
  );
}

export default App;
